INSERT INTO `product_attribute_values` VALUES (468,'en',NULL,'<p>A heart-shaped pendant necklace is a timeless and romantic piece of jewelry, often symbolizing love, affection, and connection. The pendant is typically crafted in the shape of a heart, with smooth, rounded edges that evoke a sense of warmth and tenderness. It can be made from a variety of materials, such as sterling silver, gold, platinum, or even rose gold, offering a versatile and elegant look for any occasion. &nbsp; &nbsp; The heart-shaped pendant may be simple and polished. Some designs may incorporate small details like star imbedded inside, adding to its charm. The necklace chain is usually fine and complementary to the pendant, made of the same material for a cohesive and sophisticated finish.</p>\r\n<p><strong data-end=\"97\" data-start=\"84\">Material:</strong>&nbsp;Stainless Steel<br data-end=\"116\" data-start=\"113\"><strong data-end=\"127\" data-start=\"116\">Finish:</strong>&nbsp;Gold Plated<br data-end=\"142\" data-start=\"139\"><strong data-is-only-node=\"\" data-end=\"153\" data-start=\"142\">Length:</strong>&nbsp;19 cm<br data-end=\"162\" data-start=\"159\"><strong data-end=\"177\" data-start=\"162\">Durability:</strong>&nbsp;Long-Lasting &amp; Waterproof<br data-end=\"206\" data-start=\"203\"><strong data-end=\"217\" data-start=\"206\">Weight:</strong>&nbsp;Lightweight<br data-end=\"232\" data-start=\"229\"><strong data-end=\"245\" data-start=\"232\">Features:</strong> Anti-Tarnish | Hypoallergenic</p>',NULL,NULL,NULL,NULL,NULL,NULL,31,9,'en|31|9'),(469,'en',NULL,'<p>A heart-shaped pendant necklace is a timeless and romantic piece of jewelry, often symbolizing love, affection, and connection. The pendant is typically crafted in the shape of a heart, with smooth, rounded edges that evoke a sense of warmth and tenderness. It can be made from a variety of materials, such as sterling silver, gold, platinum, or even rose gold, offering a versatile and elegant look for any occasion. &nbs