INSERT INTO `product_flat` VALUES (31,'df123','simple','1234','Heart Shape Pendant Necklace','<p>A heart-shaped pendant necklace is a timeless and romantic piece of jewelry, often symbolizing love, affection, and connection. The pendant is typically crafted in the shape of a heart, with smooth, rounded edges that evoke a sense of warmth and tenderness. It can be made from a variety of materials, such as sterling silver, gold, platinum, or even rose gold, offering a versatile and elegant look for any occasion. &nbsp; &nbsp; The heart-shaped pendant may be simple and polished. Some designs may incorporate small details like star imbedded inside, adding to its charm. The necklace chain is usually fine and complementary to the pendant, made of the same material for a cohesive and sophisticated finish.</p>\r\n<p><strong data-end=\"97\" data-start=\"84\">Material:</strong>&nbsp;Stainless Steel<br data-end=\"116\" data-start=\"113\"><strong data-end=\"127\" data-start=\"116\">Finish:</strong>&nbsp;Gold Plated<br data-end=\"142\" data-start=\"139\"><strong data-is-only-node=\"\" data-end=\"153\" data-start=\"142\">Length:</strong>&nbsp;19 cm<br data-end=\"162\" data-start=\"159\"><strong data-end=\"177\" data-start=\"162\">Durability:</strong>&nbsp;Long-Lasting &amp; Waterproof<br data-end=\"206\" data-start=\"203\"><strong data-end=\"217\" data-start=\"206\">Weight:</strong>&nbsp;Lightweight<br data-end=\"232\" data-start=\"229\"><strong data-end=\"245\" data-start=\"232\">Features:</strong> Anti-Tarnish | Hypoallergenic</p>','<p>A heart-shaped pendant necklace is a timeless and romantic piece of jewelry, often symbolizing love, affection, and connection. The pendant is typically crafted in the shape of a heart, with smooth, rounded edges that evoke a sense of warmth and tenderness. It can be made from a variety of materials, such as sterling silver, gold, platinum, or even rose gold, offering a versatile and elegant look for any occasion. &nbsp; &nbsp; The heart-shaped pendant may be simple and polished. Some designs may incorporate small details like star imbedded inside, adding to its charm. The necklace chain is usually fine and complementary to the pendant, made of the same material for a cohesive and sophisticated finish.</p>\r\n<p><strong data-end=\"97\" data-start=\"84\">Material:</strong>&nbsp;Stainless Steel<br data-end=\"116\" data-start=\"113\"><strong data-end=\"127\" data-start=\"116\">Finish:</strong>&nbsp;Gold Plated<br data-end=\"142\" data-start=\"139\"><strong data-is-only-node=\"\" data-end=\"153\" data-start=\"142\">Length:</strong>&nbsp;19 cm<br data-end=\"162\" data-start=\"159\"><strong data-end=\"177\" data-start=\"162\">Durability:</strong>&nbsp;Long-Lasting &amp; Waterproof<br data-end=\"206\" data-start=\"203\"><strong data-end=\"217\" data-start=\"206\">Weight:</strong>&nbsp;Lightweight<br data-end=\"232\" data-start=\"229\"><strong data-end=\"245\" data-start=\"232\">Features:</strong> Anti-Tarnish | Hypoallergenic</p>','heart-shape-pendant-necklace',0,1,1,'Heart Shape Pendant Necklace','Heart Shape Pendant Necklace','',1590.0000,1090.0000,'2025-11-03','2025-11-29',5.0000,'2025-11-03 14:19:59','en','default',2,31,'2025-11-03 14:28:50',NULL,1),(32,'123df','simple','','Diamond Shared Prong Band','<p data-end=\"488\" data-start=\"193\">This lab grown diamond shared prong band features a 3MM minimalist design handcrafted in solid 14K gold. Perfect for stacking, pairing with an engagement ring, or gifting on anniversaries, this band combines ethical craftsmanship with lasting brilliance and comfort.&nbsp;</p>\r\n<p>&bull; : 925 Silver, Yellow Gold, Rose Gold, White Gold<br>&bull;   &amp; : 3.0mm &amp; 2.3mm<br>&bull;  <br> Shape: Round cut&nbsp;<br> Measurement: 3 mm<br> Stone Weight: 2 TW<br> Clarity &amp; Color: VS-VVS &amp; EFG</p>','<p data-end=\"488\" data-start=\"193\">This lab grown diamond shared prong band features a 3MM minimalist design handcrafted in solid 14K gold. Perfect for stacking, pairing with an engagement ring, or gifting on anniversaries, this band combines ethical craftsmanship with lasting brilliance and comfort.&nbsp;</p>\r\n<p>&bull; : 925 Silver, Yellow Gold, Rose Gold, White Gold<br>&bull;   &amp; : 3.0mm &amp; 2.3mm<br>&bull;  <br> Shape: Round cut&nbsp;<br> Measurement: 3 mm<br> Stone Weight: 2 TW<br> Clarity &amp; Color: VS-VVS &amp; EFG</p>','diamond-shared-prong-band',0,1,1,'rings','rings','',80990.0000,74990.0000,'2025-11-03','2025-11-29',2.0000,'2025-11-03 14:29:56','en','default',2,32,'2025-11-05 01:27:23',NULL,1),(33,'er1234','simple','','Bow Heart Earring','<p>The Bow Heart Earring is a charming and romantic accessory that combines the timeless symbolism of a heart with the delicate elegance of a bow. The earring features a heart-shaped design, often adorned with sparkling cubic zirconia or enamel accents to enhance its visual appeal. At the top or side of the heart, a bow detail is incorporated, giving the earring a playful yet sophisticated touch.</p>\r\n<p><strong data-start=\"419\" data-end=\"432\">Material:</strong>&nbsp;Stainless Steel<br data-start=\"448\" data-end=\"451\"><strong data-start=\"451\" data-end=\"466\">Durability:</strong>&nbsp;Long-Lasting and Waterproof<br data-start=\"494\" data-end=\"497\"><strong data-start=\"497\" data-end=\"508\">Weight:</strong>&nbsp;8g (Lightweight)<br data-start=\"525\" data-end=\"528\"><strong data-start=\"528\" data-end=\"541\">Features:</strong>&nbsp;Anti-Tarnish | Hypoallergenic<br data-start=\"571\" data-end=\"574\" data-is-only-node=\"\"><strong data-start=\"574\" data-end=\"587\">Occasion:</strong> Ideal with Casual &amp; Formal Wear</p>','<p>The Bow Heart Earring is a charming and romantic accessory that combines the timeless symbolism of a heart with the delicate elegance of a bow. The earring features a heart-shaped design, often adorned with sparkling cubic zirconia or enamel accents to enhance its visual appeal. At the top or side of the heart, a bow detail is incorporated,