rat\', sans-serif;\\r\\n    font-size: 1.5rem;\\r\\n    font-weight: 500;\\r\\n    margin: 0 0 0px 0;\\r\\n}\\r\\n.item-overlay p {\\r\\n    font-family:\'Montserrat\', sans-serif;\\r\\n    font-size: 0.9rem;\\r\\n    margin: 0 0 15px 0;\\r\\n}\\r\\n.item-overlay a {\\r\\n    color: #fff;\\r\\n    text-decoration: none;\\r\\n    font-size: 0.9rem;\\r\\n    font-weight: 500;\\r\\n    letter-spacing: 0.1em;\\r\\n    padding-bottom: 2px;\\r\\n    border-bottom: 1px solid #fff;\\r\\n}\\r\\n\\/* ===========================\\r\\n   RESPONSIVE DESIGN\\r\\n   =========================== *\\/\\r\\n\\r\\n\\/* Medium Screens *\\/\\r\\n @media (max-width: 1200px) {\\r\\n    .prestige-gallery {\\r\\n        max-width: 600px;\\r\\n        margin: 0 auto;\\r\\n    }\\r\\n}\\r\\n\\/* Mobile: Transform into Scrollable Carousel *\\/\\r\\n @media (max-width: 768px) {\\r\\n    .prestige-container {\\r\\n        padding-left: 16px;\\r\\n    }\\r\\n    .prestige-header h2 {\\r\\n        font-size: 20px;\\r\\n    }\\r\\n    .prestige-header p {\\r\\n        font-size: 0.8rem;\\r\\n        margin-bottom: 20px;\\r\\n    }\\r\\n    \\/* Make gallery horizontal scroll *\\/\\r\\n    .prestige-gallery {\\r\\n        display: flex;\\r\\n        flex-wrap: nowrap;\\r\\n        overflow-x: auto;\\r\\n        scroll-snap-type: x mandatory;\\r\\n        -webkit-overflow-scrolling: touch;\\r\\n        gap: 15px;\\r\\n        padding: 10px 15px;\\r\\n        justify-content: flex-start;\\r\\n    }\\r\\n    \\/* Each item acts like a slide *\\/\\r\\n    .gallery-item {\\r\\n        flex: 0 0 80%;\\r\\n        height: 450px;\\r\\n        scroll-snap-align: start;\\r\\n        overflow: hidden;\\r\\n        position: relative;\\r\\n    }\\r\\n    .gallery-item img {\\r\\n        transition: transform 0.3s ease;\\r\\n    }\\r\\n    \\/* Touch feedback on tap *\\/\\r\\n    .gallery-item:active img {\\r\\n        transform: scale(0.97);\\r\\n    }\\r\\n    \\/* Hide scrollbar for cleaner look *\\/\\r\\n    